INSERT INTO `sys_article` VALUES (22, '肖申克的救赎', '1', '<p>3月21日，北京市召开新型冠状病毒肺炎<a href=\"https://www.icloudnews.net/a/20200321/29214.html\">疫情</a>防控工作新闻发布会，市疾病预防控制中心副主任庞星火介绍了本市互联网企业百度等助力海外公民，防控疫情的相关情况。</p><p align=\"center\"><img src=\"http://www.uchuanbo.com/ueditor/php/upload/image/20200321/1584799455198202.png\"></p><p>庞星火介绍，<a href=\"https://www.icloudnews.net/a/20200319/29106.html\">百度健康</a>推出“海外抗疫公益计划”，发挥平台专家资源优势，免费提供线上医疗咨询、心理咨询、专家直播等实用服务，其中，百度健康“问医生”平台有超过十万医生，提供全天候免费的在线医疗咨询服务。百度健康“问医生”的远程医疗医师团队由经过新冠肺炎专业诊疗方案培训的公立医院执业医生组成，所有海外留学生和侨胞都可以得到专业的全科室免费咨询服务。海外用户通过在百度搜索“全球抗疫”或者在百度App上搜索百度健康，进入小程序，即可全程体验公益服务。</p><p>百度数据显示，截至3月19日，百度健康“问医生”已帮助海外同胞进行越洋医疗咨询解答超20万次。</p>', 'a491272c-85d3-41bf-bf03-9469de5e69fa.jpg', '安迪', '奥斯卡电影提名as d', 2, '2020-11-11', '2019-12-12', '2020', NULL, NULL, NULL, NULL, 1);
