  `group_isenabled` enum('1','0') CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '1' COMMENT '閻犲洢鍎遍崹搴ｇ磼閸曨剚笑闁告熬绠戣ぐ鏌ユ偨?',
