-- ----------------------------
-- Records of sys_group
-- ----------------------------
BEGIN;
INSERT INTO `sys_group` VALUES (1, '单身狗组', '<h2><p><span style=\"font-family: 宋体;\">最近，《中国女排》的预告片，也是越来越多了，其中，关于陈忠和的片段，也是引发了一些争议。饰演陈忠和的演员，成年的时候，是黄渤。而最近的黄渤，也有一些预告片走红了，那就是，其抢着吃鸡腿的模样，引起了外界极大的关注，而且，这是陈忠和的模样。作为球迷，的确不敢想象。要知道，对陈忠和来说，其一直给人的感觉，是儒帅，是文雅之人。先不说黄渤的长相是否合适，光就这样一个吃鸡腿的预告来说，的确让人感觉有些不可思议。毕竟，这样的陈忠和，让人大跌眼镜。</span></p><p><span style=\"font-family: 宋体;\">源于此，在网络上也有一些传言，那就是，陈忠和对此很不满，甚至发布了公开信。这样的公开信，是一种传言，是否真实？目前还不得而知。但可以肯定的是，这样的爆料，目前的影响力，是非常大的。这一点，没有悬念。源于此，许多人也是表示，若是自己是陈忠和，也可能会不满。因为，在陈忠和的带领下，中国女排走出低谷，17年之后再次获得世界冠军。这样的陈忠和，也是不亚于郎平的功勋名帅。这样的现实下，若是其真的被丑化了，换做任何人，都是无法接受的。对陈忠和来说，作为一名儒雅之人，其是否会表达自己的不满与观点呢？这一点，是许多人好奇的地方。</span></p><p><img src=\"data:image/jpeg;base64,\" style=\"max-width:100%;\"><span style=\"font-family: 宋体;\"><br></span></p><p><span style=\"font-family: 宋体;\">也因为这样，事情的真真假假，的确不好说，或者说，给人一种不知道什么才是真相的感觉。毕竟，陈忠和没有公开表达，有的，只是网友的爆料，而网友的爆料，很多发布出来之后，又是删除了的，只不过，更多的爆料，也是及时地袭来了。如此一来，事情的真相，的确不得而知。也因为这样，许多球迷也是表示，对有关部门来说，或许也可以对此进行澄清了。那就是，是真的，就回应；是假的，就辟谣。不然的话，若是辟谣迟迟没有到来，那么真相就可能跑在谣言的后面了。这般现实与逻辑，显而易见，所以，球迷们呼吁的，还是一个真相。很多时候，真相是很可贵的，也是应该要有的。</span></p></h2>', '529b631c-81f6-4e54-b567-06f766ef698a.jpg', '1', '1111-11-11', NULL, NULL, NULL, NULL, 0);
INSERT INTO `sys_group` VALUES (2, '混吃混喝组', '<span style=\"background-color: rgb(194, 79, 74);\">狗狗狗大番薯大番好啊阿松大123123</span><img src=\"data:image/jpeg;base64,\" style=\"max-width:100%;\">', 'fa10bd11-c00d-44b5-bec0-3542f9f8fb59.jpg', '1', '1111-11-11', NULL, NULL, NULL, NULL, 0);
INSERT INTO `sys_group` VALUES (3, '深度学习组', '<p><img src=\"data:image/png;base64,\" style=\"max-width:100%;\"><br></p><p>GOOD</p>', '9bad78b1-d84e-46f8-aecb-2506d00e69bf.jpg', '1', '1111-11-11', NULL, NULL, NULL, NULL, 0);
INSERT INTO `sys_group` VALUES (4, '机器学习', '<p>1月2日，外交部发言人耿爽发布消息，应埃及外交部长舒克里、吉布提外交与国际合作部长优素福、厄立特里亚外交部长奥斯曼、布隆迪外交部长尼比吉拉、津巴布韦外交与国际贸易部长莫约邀请，国务委员兼外交部长王毅将于2020年1月7日至13日对上述国家进行正式访问。</p><p>耿爽介绍，王毅国务委员兼外长此次访问非洲五国，是中国外长自1991年以来连续第30年新年首访前往非洲。这一良好传统充分体现了中方对发展中非关系的高度重视，是中非友好历久弥坚的有力证明。</p><p>耿爽表示，今年是中非合作论坛成立20周年，也是落实2018年中非合作论坛北京峰会成果的重要一年。王国务委员兼外长访非期间，将秉持习近平主席提出的真实亲诚理念和正确义利观，同非方深入沟通对接，推动落实习近平主席同非方领导人达成的重要共识和论坛北京峰会成果，推进中非共建“一带一路”，弘扬中非传统友谊，推动双边和中非关系实现新的发展。</p><p><img src=\"data:image/jpeg;base64,\" style=\"max-width:100%;\"><br></p>', '550da64b-a208-4224-93ab-827fbd5ea84b.jpg', '1', '1111-11-11', NULL, NULL, NULL, NULL, 0);
INSERT INTO `sys_group` VALUES (5, '硬件组', '<p>CBA的常规赛继续进行，吉林男篮与青岛男篮进行了一场对决。许多人都知道，这样的对决，是琼斯与亚当斯的对决，2人都是联盟里面顶级的小外援，大家都想知道，这样的2人，到底会碰撞出什么样的火花。最终的结果，是吉林男篮以104-93击败对手。数据方面，吉林男篮的张彪18分，崔晋铭8中0贡献4分3个篮板，姜伟泽24分，霍尔曼9分10个篮板，钟诚0分8个篮板。青岛男篮的亚当斯28分6个篮板5次助攻，王庆明7分，约翰逊25分12个篮板，张骋宇14分，赵大鹏12分。</p><div><img src=\"https://ss2.baidu.com/6ONYsjip0QIZ8tyhnq/it/u=1497427199,1459720772&amp;fm=173&amp;app=25&amp;f=JPEG?w=640&amp;h=393&amp;s=12A141A046A234BE2D244D9A03003096\"></div><p>这些球员的发挥，算是出色之列，但一人的发挥，则是优秀，乃至是惊艳之列。此人，就是刚回归不久的琼斯，此前的他，被球队换掉了一段时间，因为那时候的他受伤了，但如今，琼斯归来之后，也是立马展现超强的战斗力。这样的比赛，琼斯29中14，三分10中4，罚球14中10，贡献42分11个篮板15次助攻2次盖帽的全面数据。这样的琼斯，几乎可以说，他能在篮球场上做一切的事情。得分篮板助攻，他都是全队最高的运动员，就是盖帽，也仅次于大外援霍尔曼的3次。这样的琼斯，的确没有什么可说的地方。</p><p>同样的，也凭借琼斯的优秀发挥，目前的吉林男篮，也是位列联盟第10的位置，但是，与前面球队的差距，是很小的。这背后，琼斯功不可没。甚至可以说，若不是此前琼斯受伤过一段时间，吉林男篮的战绩，肯定会更好。这一点，是没有悬念的。而本赛季到目前为止，琼斯场均可以贡献37.9分8.4个篮板8.8次助攻的全面数据，投篮命中率46.8%。这样的琼斯，场均得分联盟第一，篮板联盟第19，助攻联盟第二。这样的球员，怎么样？很优秀。同样的，其个人的PRE值是22.9，这一数据同样是联盟第五的水平。种种的事情证明一点，琼斯，是一名非常顶级的小外援，也是一名非常优秀的运动员。</p>', 'c824e86a-cdd7-4ee4-8714-b17af19f16bc.jpg', '0', '1111-11-11', NULL, NULL, NULL, NULL, 0);
INSERT INTO `sys_group` VALUES (6, '1', '1111-11-11', 'b18fa771-1e07-4126-a2a3-a0fb3e1c71f7.jpg', '0', '1111-11-11', NULL, NULL, NULL, NULL, 0);
INSERT INTO `sys_group` VALUES (7, '人工智能', '<p>我们阅尽铅华，只为呈现不一样的历史。</p><p>众所周知，黄河与长江是中国最著名的两条河流，它们也共同被国人誉为“母亲河”。早在殷商时期，黄河就已被先人记载下来，这条孕育了中华五千年的文明的滔滔大河，发源于平均4000米海拔以上的青藏高原，流域面积约752443平方公里，遍布久个省市，是中国的第二长河。</p><div><img src=\"data:image/jpeg;base64,\" style=\"font-size: 14px; max-width: 100%;\">▲奔涌不息的黄河</div><p>我国最长河——长江，也是亚洲的第一长河，同样发源于有着“世界屋脊”之称的青藏高原，流域面积达180万平方千米，遍布11个省市。除是中国水量最丰富的河流以外，长江也是世界水能第一大河，长江水资源总量达9616亿立方米，占全国总径流量的36%，是当之无愧的中国第一大河。然而鲜为人知的是，中国东北还有一条河流，流域面积超过长江，径流量更是黄河的7倍，它就是东北边境河流——黑龙江。</p><div><br></div><p>黑龙江，流经朝鲜、蒙古、中国和俄罗斯四国，俄语称其为阿穆尔河，蒙古语称哈拉穆河，中国古代则称之为“羽水”、“弱水”、“黑水”、“浴水”、“望建河”或者“石里罕水”等。究其原因，是由于河水含有腐殖质较多，水色发黑，所以才会有上述称呼，地方志中亦记载“黑龙江水黑，蜿如蛟龙，故名为黑龙江”。历史上，人们也以额尔古纳河称呼黑龙江，史籍则多记载为“望建河”，《旧唐书》《元史》等都有对黑龙江的有</p>', '5a4f4ce7-c47e-41d6-8136-1b1a3093caa2.png', '1', '1111-11-11', NULL, NULL, NULL, NULL, 0);
